import React, { useState } from 'react';
import './Products.css';

const Products = () => {
  const [category, setCategory] = useState('All');

  const categories = ['All', 'Dog', 'Cat', 'Accessories', 'Rabbit', 'Rodents', 'Fish', 'Bird', 'Food', 'Aquari'];
  const products = [
    { id: 1, name: 'Dog Food', category: 'Dog' },
    { id: 2, name: 'Cat Toy', category: 'Cat' },
    { id: 3, name: 'Dog Collar', category: 'Accessories' },
    { id: 4, name: 'Cat Bed', category: 'Cat' },
    // Add more products as needed
  ];

  const filteredProducts = category === 'All' ? products : products.filter(product => product.category === category);

  return (
    <div className="App">
      <header className="header">
        <img src="./images/products.png" alt="Pet Shop Header" className="header-image" />
      </header>
      <div className="content">
        <aside className="sidebar">
          <ul>
            {categories.map(cat => (
              <li key={cat} onClick={() => setCategory(cat)}>{cat}</li>
            ))}
          </ul>
        </aside>
        <main className="main">
          <div className="products">
            {filteredProducts.map(product => (
              <div className="card" key={product.id}>
                <h3>{product.name}</h3>
                <p>{product.category}</p>
              </div>
            ))}
          </div>
        </main>
      </div>
    </div>
  );
}

export default Products;
